import React from "react";
import Perfil from "../Img/fotoFondo.jpg";
import "./Content.css";

const Content = () => {
  return (
    <div className="container">
      <div className="row text-start">
        <div className="col-8 bg-danger">
          <div className="row">
            <div className="col">Hello, I am</div>
          </div>
          <div className="row">
            <div className="col">
              <h1>Ricardo</h1>
            </div>
          </div>
          <div className="row">
            <div className="col">
              <h1>Ramirez</h1>
            </div>
          </div>
        </div>
        <div className="col-4 h-img-full">
          <img src={Perfil} alt="perfil" className="img-fluid h-img" />
        </div>
      </div>
    </div>
  );
};

export default Content;
